import React, { useState } from 'react';

function Form() {
  return (
    <form>
      <input type="text" name="" id="" />
    </form>
  );
}

function App() {
  const [showForm, setShowForm] = useState(false);

  const toggleForm = () => {
    setShowForm(!showForm);
  };

  return (
    <div>
      <button onClick={toggleForm}>{showForm ? 'Hide Form' : 'Show Form'}</button>
      {showForm && <Form />}
    </div>
  );
}

export default App;
